(2, 1, '2021-01-12 09:11:08', '2021-01-12 09:11:08', '<!-- wp:paragraph -->\n<p>Aceasta este o pagină exemplu. Este diferită de un articol de blog deoarece ea va rămâne într-un singur loc și va apărea în navigarea pe situl tău (în majoritatea temelor). Foarte multe persoane încep cu o pagină Despre în care se prezintă potențialilor vizitatori ai sitului. Ar putea spune ceva de genul acesta:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Salut! În timpul zilei sunt un curier pe bicicletă iar noaptea un actor în devenire și-acesta este situl meu. Locuiesc în București, am un câine grozav pe care-l cheamă Max și-mi place berea. (Și să mă prindă ploaia pe-afară).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>... sau ceva de genul:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Compania XYZ Măruțișuri SRL a fost înființată în 1990 și de atunci oferă publicului mărunțișuri de calitate. Aflată în orașul Caracal, XYZ angajează peste 2000 de oameni și face și o sumă de lucruri deosebite pentru comunitatea din Caracal.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Ca utilizator WordPress nou, ar trebui să mergi la <a href=\"http://localhost:8888/cupfocsani.wp/wp-admin/\">Panoul tău de control</a> ca să ștergi această pagină și să creezi pagini noi pentru conținutul tău. Distracție plăcută!</p>\n<!-- /wp:paragraph -->', 'Pagină exemplu', '', 'publish', 'closed', 'open', '', 'pagină-exemplu', '', '', '2021-01-12 09:11:08', '2021-01-12 09:11:08', '', 0, 'http://localhost:8888/cupfocsani.wp/?page_id=2', 0, 'page', '', 0),
(3, 1, '2021-01-12 09:11:08', '2021-01-12 09:11:08', '<!-- wp:heading --><h2>Cine ești (suntem)</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Adresa sitului web este: http://localhost:8888/cupfocsani.wp.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ce date personale colectăm și de ce le colectăm</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comentarii</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Când vizitatorii lasă comentarii pe sit, colectăm datele arătate în formularele de comentarii, dar și adresa IP a vizitatorului și șirul agenților utilizator din navigator pentru a ne ajuta la detectarea spamului.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Un șir făcut anonim (numit și un hash), creat din adresele tale de email, poate fi furnizat serviciului Gravatar pentru a vedea dacă îl folosești. Politica de confidențialitate a serviciului Gravatar este disponibilă aici: https://automattic.com/privacy/. După aprobarea comentariului, fotografia ta de profil este vizibilă pentru public lângă comentariul tău.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Dacă încarci imagini pe situl web, ar trebui să eviți încărcarea imaginilor care au incluse date de locație înglobate (EXIF GPS). Vizitatorii sitului web pot descărca și extrage toate datele despre locație din imaginile de pe sit.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formulare de contact</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookie-uri</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Dacă lași un comentariu pe situl nostru, poți opta pentru salvarea în cookie-uri a numelui, adresei de email și sitului tău web. Acestea sunt pentru confortul tău, astfel nu mai trebuie să le completezi din nou când lași un alt comentariu. Aceste cookie-uri vor fi valabile un an.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Dacă mergi la pagina noastră de autentificare, vom seta un cookie temporar pentru a determina dacă navigatorul tău acceptă cookie-uri. Acest cookie nu conține date personale și este eliminat când închizi navigatorul.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Când te autentifici, vom seta și câteva cookie-uri pentru a-ți salva informațiile de autentificare și opțiunile de afișare pe ecran. Cookie-urile de autentificare sunt păstrate două zile, iar cele pentru opțiuni de afișare pe ecran sunt păstrate un an. Dacă selectezi „Ține-mă minte”, cookie-urile tale de autentificare vor fi păstrate două săptămâni. Dacă te dezautentifici din cont, cookie-urile de autentificare vor fi eliminate.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Dacă editezi sau publici un articol, un cookie suplimentar va fi salvat în navigatorul tău. Acest cookie nu include date personale și indică pur și simplu ID-ul articolului pe care tocmai l-ai editat. El expiră după 1 zi.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Conținut înglobat de pe alte situri web</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articolele din acest sit pot include conținut înglobat (de exemplu, videouri, imagini, articole etc.). Conținutul înglobat de pe alte situri web se comporta exact la fel ca și cum vizitatorii au vizualizat un alt sit web.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Aceste situri web pot să colecteze date despre tine, să folosească cookie-uri, să înglobeze urmărirea suplimentară de la părți terțe și să-ți monitorizeze interacțiunea cu conținutul înglobat, inclusiv să-ți urmărească interacțiunea cu conținutul înglobat dacă ai un cont și ești autentificat în acel sit web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analitice</h3><!-- /wp:heading --><!-- wp:heading --><h2>Cu cine partajăm datele tale</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Dacă ceri resetarea parolei, adresa ta IP va fi inclusă în emailul pentru resetare.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cât timp îți păstrăm datele</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Dacă lași un comentariu, comentariul și metadatele lui sunt păstrate pe o perioadă nedeterminată. Așa putem recunoaște și aproba automat toate comentariile următoare în loc să le ținem într-o coadă pentru moderare.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Pentru utilizatorii (dacă există) care se înregistrează pe situl nostru web, stocăm și informațiile personale pe care le furnizează în profilul lor de utilizator. Toți utilizatorii își pot vedea, edita sau șterge informațiile personale oricând (dar nu își pot schimba numele de utilizator). De asemenea, administratorii sitului web pot vedea și edita aceste informații.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ce drepturi ai asupra datelor tale</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Dacă ai un cont sau ai lăsat comentarii pe acest sit web, poți cere să primești un fișier de export cu datele personale pe care le deținem despre tine, inclusiv toate datele pe care ni le-ai furnizat. De asemenea, ne poți cere să ștergem toate datele personale pe care le deținem despre tine. Acestea nu includ toate datele pe care suntem obligați să le păstrăm în scopuri administrative, juridice sau de securitate.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Unde îți trimitem datele</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Comentariile vizitatorilor pot fi verificate printr-un serviciu automat de detectare a spamului.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Informațiile tale de contact</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informații suplimentare</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cum îți protejăm datele</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Ce proceduri avem la dispoziție pentru încălcarea securității datelor</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>De la care părți terțe primim date</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Ce decizii luăm și/sau ce profiluri realizăm automat cu datele utilizatorilor</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cerințe pentru divulgarea unei afaceri controlată de guvern</h3><!-- /wp:heading -->', 'Politică de confidențialitate', '', 'draft', 'closed', 'open', '', 'politica-de-confidentialitate', '', '', '2021-01-12 09:11:08', '2021-01-12 09:11:08', '', 0, 'http://localhost:8888/cupfocsani.wp/?page_id=3', 0, 'page', '', 0),
